(59,103,11,0,2000000,'2023-04-06 14:26:50','2023-04-06 23:22:34','정진호님의 요로 결석','<p><br></p><p>정진호님이 요로 결석으로 인해 매우 힘들어하고 계시다는 것을 알고 있습니다. 이러한 상황에서 기부를 통해 도움을 받을 수 있다면, 이것이 정말로 큰 차이를 만들어줄 것입니다.</p><p>우리는 언제나 다른 사람을 도울 수 있는 기회가 있습니다. 그리고 이번에 그 기회가 바로 정진호님이라는 분께서 제공해주시는 것입니다. 그분이 필요로 하는 지원을 제공하는 것은 그분에게 큰 도움이 될 것이며, 또한 우리 자신에게도 큰 보람을 주게 됩니다.</p><p>따라서, 정진호님의 상황에 대해 기부자들과 이야기하며, 그분이 어떻게 도움을 받을 수 있는지 알려주시면 좋을 것입니다. 그리고 그분이 받게 될 지원이 얼마나 큰 차이를 만들어줄 수 있는지, 그것이 얼마나 중요한 일인지에 대해 이야기해주시면 더욱 좋을 것입니다.</p><p>감사합니다.</p>','https://storage.googleapis.com/download/storage/v1/b/carrot_box555/o/img%2F82b03a9e-1716-48fa-b28c-c1d991b72fe7-%EC%A0%95%EC%9B%90%EC%B2%A0.jpg?generation=1680791210726693&alt=media',0,0,'정엔투엔철 병원',20,'입원비/수술비/의약품'),
(60,104,16,0,2000000,'2023-04-06 14:39:04','2023-04-21 22:00:00','골다골증에 걸린 정다니엘을 도와주세요','<p><br></p><p>정다니엘님이 골다공증으로 인해 힘든 시기를 겪고 계시다는 것을 알고 있습니다. 이러한 상황에서 기부를 통해 도움을 받을 수 있다면, 이것이 정말로 큰 도움이 될 것입니다.</p><p>우리는 언제나 다른 사람을 도울 수 있는 기회가 있습니다. 이번에 그 기회가 바로 정다니엘님이라는 분께서 제공해주시는 것입니다. 그분이 필요로 하는 지원을 제공하는 것은 그분에게 큰 도움이 될 것이며, 또한 우리 자신에게도 큰 보람을 주게 됩니다.</p><p>따라서, 정다니엘님의 상황에 대해 기부자들과 이야기하며, 그분이 어떻게 도움을 받을 수 있는지 알려주시면 좋을 것입니다. 그리고 그분이 받게 될 지원이 얼마나 큰 도움이 되는지, 그것이 얼마나 중요한 일인지에 대해 이야기해주시면 더욱 좋을 것입니다.</p><p>기부는 단순히 돈을 주는 것이 아니라, 그분의 어려움을 이해하고 그분을 돕기 위해 함께 노력하는 것입니다. 함께 동참하여 정다니엘님의 상황을 나은 방향으로 바꿀 수 있도록 노력해봅시다.</p><p>감사합니다.</p>','https://storage.googleapis.com/download/storage/v1/b/carrot_box555/o/img%2Fe7aff3fa-7ffa-49f0-896f-840062a93469-2024980_2029675_518.jpg?generation=1680791944490155&alt=media',0,0,'정엔투엔철 병원',20,'입원비/수술비/의약품');
